const GrainySVGBackground = () => {
  return (
    <div className="relative w-full h-full bg-gray-900 overflow-hidden">
      {/* SVG noise filter */}
      <svg className="absolute inset-0 w-full h-full">
        <defs>
          <filter id="noiseFilter" x="0%" y="0%" width="100%" height="100%">
            <feTurbulence baseFrequency="0.9" numOctaves="4" result="noise" seed="2" />
            <feColorMatrix in="noise" type="saturate" values="0" result="monoNoise" />
            <feComponentTransfer in="monoNoise" result="grain">
              <feFuncA type="discrete" tableValues="0.88 0.9 0.92 0.94 0.96 0.98 1" />
            </feComponentTransfer>
            <feBlend in="grain" in2="SourceGraphic" mode="multiply" result="blend" />
          </filter>
        </defs>
        <rect width="100%" height="100%" fill="#111827" filter="url(#noiseFilter)" />
      </svg>

      {/* Additional CSS-based grain overlay for enhanced effect */}
      <div
        className="absolute inset-0 opacity-40"
        style={{
          backgroundImage: `
            radial-gradient(circle at 25% 25%, #ffffff 1px, transparent 1px),
            radial-gradient(circle at 75% 75%, #ffffff 1px, transparent 1px)
          `,
          backgroundSize: "4px 4px, 6px 6px",
          backgroundPosition: "0 0, 2px 2px",
          mixBlendMode: "screen",
        }}
      />

      {/* Fine grain texture overlay */}
      <div
        className="absolute inset-0 opacity-20"
        style={{
          background: `
            repeating-linear-gradient(
              0deg,
              transparent,
              transparent 1px,
              rgba(255, 255, 255, 0.03) 1px,
              rgba(255, 255, 255, 0.03) 2px
            ),
            repeating-linear-gradient(
              90deg,
              transparent,
              transparent 1px,
              rgba(255, 255, 255, 0.03) 1px,
              rgba(255, 255, 255, 0.03) 2px
            )
          `,
        }}
      />
    </div>
  )
}

export default GrainySVGBackground


